import React from 'react';

const Message = (props) => {
    return (
        <small> {props.totalMessage} messages </small>
    );

};

class Sender extends React.Component{
    constructor(props){
        super(props);
    }

    render() {

        return (
            <div className={"sender"}>
                <h3 className="box-title">{this.props.user.first_name} {this.props.user.sur_name}</h3>
                {this.props.totalMessage > 1 ? <Message totalMessage={this.props.totalMessage}/> : ""}
            </div>
        );
    }
}

export default Sender;
